import { useState} from "react";
import axios from "axios";
const [getCandidate, setGetCandidate] = useState([]);
const GetCandidate = () => {
  axios({
    method: "get",
    url: "http://localhost:3001/get-candidate",
    responseType: "json",
  }).then((response) => {
    setGetCandidate(response.data.data)
  });
  return getCandidate;
};

export {GetCandidate}
